import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Ap from "./Ap";
import Navbar from "./Components/Navbar";
import Register from "./Pages/Register";
import Home1 from "./Components/Home1";

function Router(){
    return (
        <BrowserRouter>
        <Navbar />
        <Routes>
            <Route className="nav" path ="/" element= {<Home1 />}/>
            <Route className="nav" path ="/login" element= {<Ap />}/>
            <Route className="nav" path ="/register" element= {<Register />}/>
        </Routes>

        </BrowserRouter>

    ) 
}

export default Router;
